    return(
        <div>
        <div>
        <tr>
    <td  >المدن</td>
    <td >عدد السكان</td>
    <td>
    <button > تعديل   </button> 
    <button onClick="delet()"> حدف  </button> 
    </td>
</tr>
        {Cities.map(function data(d) {
         return(

             
                
    <table id="table" key={d.id} >
          
    <tr >
    <td >{d.citie}</td>
    <td >{d.peples}</td>
</tr>
</table>

             )   
        })}
        </div>
        </div>
    )
    
}
export default Table;
